import React from 'react';
import './ItemDetail.css';
function ItemDetail({item}){
    return(
            <div class='container'>
                <div class="images">
                </div>
                <div class = "details">
                    <h1>{item.name}</h1>
                    <h2>Start from - ${item.startingPrice}</h2>
                </div>

        
            </div>


    );

}

export default ItemDetail;
